import React from 'react';
import { create, injectStyle } from 'react-free-style';

const Style = create();

const CONTAINER_STYLE = Style.registerStyle({
  backgroundColor: '#ff0000',
  width: '520px',
  height: '400px'
})


const Term = () =>{
  return(
    <div className={CONTAINER_STYLE.className}>

    </div>
  )
}

export default Term
